import MovieCard from "../components/MovieCard";
import "../styl/MovieCard.css";

const movies = [
  { id:1, title:"Inception", year:2010, poster:"https://image.tmdb.org/t/p/w300/qmDpIH..." },
  { id:2, title:"Interstellar", year:2014, poster:"https://image.tmdb.org/t/p/w300/rAiYT..." },
  // ...more or load from API
];

function Movies() {
  return (
    <div className="movies-page">
      <h1>ภาพยนตร์</h1>
      <div className="movies-grid">
        {movies.map(m => <MovieCard key={m.id} movie={m} />)}
      </div>
    </div>
  );
}

export default Movies;
